import React from "react"
import { Navbar } from "react-bootstrap"

const Header = () => {
	return (
		<div>
			<Navbar bg="dark" expand="lg">
				<Navbar.Brand>Snake Game</Navbar.Brand>
			</Navbar>
		</div>
	)
}

export default Header
